const Card=(props)=>{
return(
    
    <div className="card">
        <div className="card-border-top">
        </div>
        
            <img src="./developers images/WhatsApp Image 2024-03-11 at 11.37.29_87adf806.jpg" alt="Momen Picture"/>
        
        <span> {props.member}</span>
        <p className="job">{props.memberrole}</p>
        

      </div>
)
}

export default Card
